    //   .then((data) => {
    //     setData(data);
    //     console.log(data);
    //   });
  }, []);

  return (
    <div>
      <p>{message}</p>

      {typeof data.members === "undefined" ? (
        <p>Loading...</p>
      ) : (
        data.members.map((member, i) => <p key={i}> {member}</p>)
      )}
    </div>
  );
}

export default App;
